import React from 'react';


const style_block = {
  display: 'block',
}

const style_flex = {
  display: 'flex',
}

const Inputs_left = () => {

  return (<div style={style_block}>
    <label style={style_block}>Країна<input style={style_block} type="text"></input></label>

    <div style={style_flex}>
      <label style={style_block}>Місто<input style={style_block} type="text"></input></label>
      <label style={style_block}>Штат, район<input style={style_block} type="text"></input></label>
    </div>
    <label style={style_block}>Адреса<input style={style_block} type="text"></input></label>
    <label style={style_block}>Поштовий індекс<input style={style_block} type="text"></input></label>
  </div >
  );

}

export default Inputs_left;
